import React from 'react';
import PropTypes from 'prop-types';

const CheckBoxInput = ({ ing }) => {
  return (
    <div>
      <input
        type="checkbox"
        id={ ing }
      />
      <label
        htmlFor={ ing }
      >
        { ing }
      </label>
    </div>
  );
};

CheckBoxInput.propTypes = {
  ing: PropTypes.string.isRequired,
};

export default CheckBoxInput;
